INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2723, 6304, 'Selumetinib', 'Grapefruit juice may increase the plasma concentrations of selumetinib, which undergoes metabolism primarily by CYP450 3A4 and to a lesser extent by CYP450 2C19, 1A2, 2C9, 2E1 and 3A5, as well as glucuronidation by UGT1A1 and UGT1A3.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  Inhibition of hepatic CYP450 3A4 may also contribute.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2724, 6305, 'Selumetinib', 'Grapefruit juice may increase the plasma concentrations of selumetinib, which undergoes metabolism primarily by CYP450 3A4 and to a lesser extent by CYP450 2C19, 1A2, 2C9, 2E1 and 3A5, as well as glucuronidation by UGT1A1 and UGT1A3.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  Inhibition of hepatic CYP450 3A4 may also contribute.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2725, 24039, 'Simeprevir', 'Food significantly enhances the oral bioavailability of simeprevir, although the type of food does not seem to matter.  In healthy study subjects, administration of simeprevir after a high-fat, high-caloric (928 kcal) breakfast increased systemic exposure (AUC) by 61% and delayed absorption by 1 hour, while administration after a normal caloric (533 kcal) breakfast increased AUC by 69% and delayed absorption by 1.5 hours.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c0dc4d10d80300805c055de00c6695c80069a9294d240ab8eaff771974346ee1018bd6ad4e1f147253de6521f07524d66c8ad816cbe3ba308884d87e69210c6a3aba1baf3f901a9e91dc1', NULL, X'');
