INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2738, 4799, 'Silodosin', 'Food may reduce the oral bioavailability of silodosin.  The effect of a moderate-fat, moderate-calorie meal on silodosin pharmacokinetics was variable and decreased silodosin maximum plasma concentration (Cmax) by approximately 18% to 43% and systemic exposure (AUC) by 4% to 49% across three different studies.  The maximum effect of food (i.e., coadministration with a high-fat, high-calorie meal) on the pharmacokinetics of silodosin was not evaluated.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c15ccd10d80200c05c055de04cee20a953e4303d284165cdff87dc99d92c69181a8bebae2226c44ce55928a74a43422acbb7ad8c06b59217828fdd7495d85c84a4c8b06bf21ba3983e0fedfe303ee4923d3', NULL, X'');
