INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2827, 5365, 'Sucralfate', 'The administration of sucralfate with enteral nutrition may result in precipitation and the formation of bezoars that may obstruct feeding tubes.  The proposed mechanism is the formation of an insoluble aluminum-protein complex between the aluminum in the sucralfate and the protein in the enteral feeding.  In addition, sucralfate may not become activated due to the alkaline pH of enteral nutrition products.', 'food', 'Moderate', '', 'DDInter', 0, X'789c158cc10dc2400c045bd9025024e8801f7f2a70924d72d29d7db21d44bae7f8ce8ce66d8de0b7d333e05cac35ea8a6017972cba230f22cec5a56e92c46ac1c0e6d6404d0e8c8d5c4719982f48a2522271c761a74fc0b38e4ac7ebc37addb0984659f99f9ba2c98599d88754a4a1bbe5c0fd6c1d458f3297340f98e3f58068ca6e5a2263fa01c8b5441a', NULL, X'');
