INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2881, 3184, 'Tamsulosin', 'The concurrent use of ethanol and alpha-1 adrenergic blockers may cause increased hypotensive effects.  Patients with aldehyde dehydrogenase deficiencies (primarily Asians) may be at a higher risk of this interaction.  The mechanism has not been determined.  Data exist for prazosin and other alpha adrenergic blockers are expected to interact also.  In addition, any patients taking alpha adrenergic blockers may experience excessive orthostatic hypotension with ethanol ingestion, due to ethanol''s unopposed vasodilatory effects in the presence of alpha adrenergic blockade. ', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
