INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2897, 3184, 'Tamsulosin', 'Food may delay the gastrointestinal absorption of tamsulosin.  The time to maximum plasma concentration (Tmax) is reached by 4 to 5 hours under fasted conditions and by 6 to 7 hours when tamsulosin is administered with food.  The delay in Tmax has the desirable effect of smoothing the tamsulosin plasma concentration profile, thereby reducing fluctuation of the plasma peak and trough concentrations with multiple dosing.  Food may also affect the extent of absorption of tamsulosin.  It has been reported that taking tamsulosin under fasted conditions results in a 30% increase in bioavailability (AUC) and 40% to 70% increase in peak plasma concentration (Cmax) compared to fed conditions.  The effects of food on the pharmacokinetics of tamsulosin are consistent regardless of whether tamsulosin is taken with a light meal or a high-fat meal.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c0dcbdb0dc2300c05d055ee00c0342ce0360eb1e4476427826e4fffcf7907d86b2763bbf4489375213ae8a8c8b924fc8145565ba3c45123b6361c0c6a262eb538b981e6ccf889d162bdbbf3739076dc38d14335bee21facc1283286312998ce8146d7eb0feaf83157', NULL, X'');
